import React, { useEffect } from 'react';
import { useState } from "react";
import { common, msgStyle } from "../common/common";
// import Profile from './Profile';
import $ from 'jquery'; 
import { json } from 'stream/consumers';

const Mainmenu = () => {

  const lng = common.lng;
  const sid = common.data('sid');	
  const logedId = common.data('logedId');	
  const logedNick = common.data('logedNick');	
  const logedAvatar = common.data('logedAvatar');	

  // onLoad event handler
	   useEffect(() => {
		$('#waiting').hide();
	});	

   return (
    <div id="Mainmenu">
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
            <a className="navbar-brand" href="#">Navbar</a>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse"
                 onClick={ $('#navbarSupportedContent').toggle }
                 data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                <li className="nav-item">
                <a className="nav-link active" aria-current="page" href="#">Home</a>
                </li>
                <li className="nav-item">
                <a className="nav-link" href="#">Link</a>
                </li>
                <li className="nav-item dropdown">
                <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                    Dropdown
                </a>
                <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                    <li><a className="dropdown-item" href="#">Action</a></li>
                    <li><a className="dropdown-item" href="#">Another action</a></li>
                    <li><hr className="dropdown-divider" /></li>
                    <li><a className="dropdown-item" href="#">Something else here</a></li>
                </ul>
                </li>
            </ul>
            </div>
        </div>
        </nav>        
    </div>
   );     

};

export default Mainmenu;
